import React from 'react'
import './button.css'
const Button = ({ icon, name, bgColor = '#ff3700', color = '#ffffff' }) => {
    return (
        <div>
            <a href="#" className="mainBtn" style={{color:color , Background:bgColor}}>
                {icon} {name}
            </a>


        </div>
    )
}

export default Button;
